import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';

const EditLesson = () => {
  const navigate = useNavigate();
  const { lessonId } = useParams();
  const [formData, setFormData] = useState({
    title: '',
    description: '',
    video_url: '',
    order_no: '',
    is_published: false,
    course_pdf: null
  });
  const [existingPdf, setExistingPdf] = useState(null);
  const [loading, setLoading] = useState(true);
  const [submitting, setSubmitting] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const userData = JSON.parse(localStorage.getItem('userData') || '{}');

  // Charger les donnÃ©es du lesson
  useEffect(() => {
    fetchLesson();
  }, [lessonId]);

  const fetchLesson = async () => {
    try {
      setLoading(true);
      const response = await axios.get(
        `http://localhost:1337/api/lessons/${lessonId}?populate=course_pdf`
      );

      const lesson = response.data.data;
const lessonData = lesson.attributes; // âœ… AccÃ¨s aux attributs
      
/* eslint-disable */console.log(...oo_oo(`133347136_39_0_39_41_4`,'Lesson chargÃ©:', lessonData));

setFormData({
  title: lessonData.title || '',
  description: lessonData.description || '',
  video_url: lessonData.video_url || '',
  order_no: lessonData.order_no || '',
  is_published: lessonData.is_published || false,
  course_pdf: null
});

if (lessonData.course_pdf?.data) {
  setExistingPdf(lessonData.course_pdf.data);
}

      setError('');
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`133347136_56_6_56_55_11`,'Erreur chargement lesson:', error));
      setError('Impossible de charger le cours');
    } finally {
      setLoading(false);
    }
  };

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleFileChange = (e) => {
    const file = e.target.files[0];
    setFormData(prev => ({
      ...prev,
      course_pdf: file
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    setError('');
    setSuccess('');

    try {
      // Ã‰tape 1: Mettre Ã  jour les donnÃ©es du lesson
      const lessonData = {
        data: {
          title: formData.title,
          description: formData.description,
          video_url: formData.video_url,
          order_no: formData.order_no ? parseInt(formData.order_no) : null,
          is_published: formData.is_published
        }
      };

      /* eslint-disable */console.log(...oo_oo(`133347136_97_6_97_58_4`,'ðŸ“¤ Mise Ã  jour du lesson:', lessonData));

      await axios.put(
        `http://localhost:1337/api/lessons/${lessonId}`,
        lessonData,
        {
          headers: {
            'Content-Type': 'application/json',
          }
        }
      );

      // Ã‰tape 2: Upload du nouveau PDF si prÃ©sent
      if (formData.course_pdf) {
        /* eslint-disable */console.log(...oo_oo(`133347136_111_8_111_50_4`,'ðŸ“Ž Upload du nouveau PDF...'));
        
        const formDataToSend = new FormData();
        formDataToSend.append('files', formData.course_pdf);
        formDataToSend.append('ref', 'api::lesson.lesson');
        formDataToSend.append('refId', lessonId);
        formDataToSend.append('field', 'course_pdf');

        await axios.post(
          'http://localhost:1337/api/upload',
          formDataToSend,
          {
            headers: {
              'Content-Type': 'multipart/form-data',
            }
          }
        );

        /* eslint-disable */console.log(...oo_oo(`133347136_129_8_129_36_4`,'âœ… PDF uploadÃ©'));
      }

      setSuccess('âœ… Cours modifiÃ© avec succÃ¨s!');
      
      setTimeout(() => {
        navigate('/dashboard-teacher');
      }, 2000);

    } catch (error) {
